def _get_time_bins(self, ax):
    if not isinstance(ax, DatetimeIndex):
        raise TypeError(
            "axis must be a DatetimeIndex, but got "
            f"an instance of {type(ax).__name__}"
        )

    if len(ax) == 0:
        binner = labels = DatetimeIndex(data=[], freq=self.freq, name=ax.name)
        return binner, [], labels

    first = ax[0]
    last = ax[-1] + self.freq
    binner = date_range(
        start=first, end=last, freq=self.freq, tz=ax.tz, name=ax.name
    )

    # Drop the last element that is added due to end being inclusive in date_range
    binner = binner[:-1]

    bin_edges = binner.values.astype('datetime64[ns]').astype('int64')
    bins = lib.generate_bins_dt64(ax.asi8, bin_edges, closed=self.closed, hasnans=ax.hasnans)

    if self.closed == "right":
        labels = binner
        if self.label == "right":
            labels = labels[1:]
    elif self.label == "right":
        labels = labels[1:]

    if ax.hasnans:
        binner = binner.insert(0, NaT)
        labels = labels.insert(0, NaT)

    # if we end up with more labels than bins
    # adjust the labels
    if len(bins) < len(labels):
        labels = labels[: len(bins)]

    return binner, bins, labels
